import requests
import pandas as pd
import os

#get current working directory
print(os.getcwd())

# https://www.morningstarfunds.ie/ie/screener/fund.aspx#?filtersSelectedValue=%7B%7D
# Format of link is : 'https://api-global.morningstar.com/sal-service/v1/fund/portfolio/holding/v2/(insert code of fund here)/data'

list1 = [("Fundsmith Equity R Acc EUR","F00000O9HI"),("Amundi Pioneer US Equity Fundamental Growth A USD","F000013QY7"),("Pictet Premium Brands HP SGD","F00000MSZX"),
                ("Pictet Security P USD","F0000000KZ"),("Robeco Global Consumer Trends Equities D USD","F00000Q1YC"),("BlackRock BGF World Energy A2 Hedged SGD","F000002GK3"),
                ("BlackRock GF Latin American A2 Hedged SGD","F00000LYEB"), ("BlackRock GF World Gold A2 Hedged SGD","F000002GJV"),("BlackRock GF World Technology A2 USD","F0GBR04AMX"),
                ("BlackRock Global Allocation A2 Hedged SGD","F000000IK9"),("BlackRock World Mining A2 Hedged SGD","F000000RN7"),("Franklin Technology A Acc USD", "F0GBR04V77"),
                ("JPM Brazil Equity A Acc NAV SGD","F00000JNYY"), ("JPM Greater China A Acc NAV USD","F0GBR05VWV"),("JPM India A Acc NAV USD","F0GBR05VW6")]
new_list=[]
for (name,code) in list1:
    
    link = 'https://api-global.morningstar.com/sal-service/v1/fund/portfolio/holding/v2/' + code + '/data' 
    # example link = 'https://api-global.morningstar.com/sal-service/v1/fund/portfolio/holding/v2/F00000MSZX/data'  

    headers = {
        'apikey': 'lstzFDEOhfFNMLikKa0am9mgEKLBl49T',
        'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/100.0.4896.127 Safari/537.36'
    }

    payload = {
        'premiumNum': '100',
        'freeNum': '25',
        'languageId': 'en',
        'locale': 'en',
        'clientId': 'MDC',
        'benchmarkId': 'mstarorcat',
        'component': 'sal-components-mip-holdings',
        'version': '3.59.1'
    }

    with requests.Session() as s:
        s.headers.update(headers)
        resp = s.get(link,params=payload)
        container = resp.json()
   
    # extract all the corresponding values for each category into a list 
    morningstar = container['equityHoldingPage']['holdingList']
    securityName = [x["securityName"] for x in morningstar]
    Weightage = [x["weighting"] for x in morningstar]
    numberOfShare = [x["numberOfShare"] for x in morningstar]
    firstboughtdate = [x['firstBoughtDate'] for x in morningstar]
    country = [x['country'] for x in morningstar]
    economicMoat = [x['economicMoat'] for x in morningstar]
    sector = [x['sector'] for x in morningstar]
    sectorcode = [x['sectorCode'] for x in morningstar]
    # label each row with the fund it is derived from, for the first column
    fund = [name]*len(securityName)
    # create the list of features associated with the security, is the 
    y = list(zip(fund, securityName, Weightage, numberOfShare, firstboughtdate, country, economicMoat, sector, sectorcode))
    # for printing each fund securities
    new_list += y

# put the list into columns
df = pd.DataFrame(new_list)
df.columns = ['fund','securityName', 'Weightage', 'numberOfShare', 'firstboughtdate','country','economicMoat','sector','sectorcode']

writer = pd.ExcelWriter('test.xlsx', engine='xlsxwriter')
df.to_excel(writer, sheet_name='Funds', index=False)
# dynamically adjust all the column lengths
for column in df:
    column_length = max(df[column].astype(str).map(len).max(), len(column))
    col_idx = df.columns.get_loc(column)
    writer.sheets['Funds'].set_column(col_idx, col_idx, column_length)
# save the excel file
writer.save()


print(df)

